import React, {useState, useEffect} from "react";

export function Fish() {
    const [fish, setFish] = useState([]);

    useEffect(() => {
        fetch("https://acnhapi.com/v1/fish")
        .then((response) => response.json())
        .then((fish) => setFish(Object.values(fish)));

}, []);

return (
    <section>
        <h1>List of fish</h1>
        {fish.map((fish) => (
            <FishItem key={fish.id} fish={fish} />
        ))}
        </section>
)}

const FishItem = ({fish}) =>
    <div>
        <p>{fish.name.name-USen}</p>
    </div>
